import React from "react";
import curso from "../data/Pruebas";
const Inicio = ()=>{
    return(
        <div>
            <h1>Incio</h1>
            <ul>
                { curso.map(iten=>(
                        <li key={iten.id}>
                            <Link to ={`/Inicio/${iten.id}`}> 
                                {iten.titulo}
                                {iten.actualizacion}
                                {iten.id}
                            </Link>
                        </li>
                    ))
                }
            </ul>
        </div>

    )

}

export default Inicio;
